import React, { useEffect,useState } from 'react'
import {gsap} from 'gsap'

const App = () => {
  var tween=gsap.to(".pen1",{y:300,stagger:{each:1,from:"end"},paused:true})
    var tween2=gsap.to(".pen2",{y:300,stagger:{each:2,from:"center"},paused:true})
 
 const handleplay=()=>{
  
  tween.play()
  tween2.play()

 }
 const handlepause=()=>{
  tween.paused();
  tween2.pause()
 }
 const handlereverse=()=>{
  tween.reverse();
  tween2.reverse()
 }
 const handlerestart=()=>{
  tween.restart()
  tween2.restart()
 }
  useEffect(()=>{
    
    
    gsap.to(".container",{background:"lightgreen",duration:3})
    
    
  },[])

  return (
     <div  className='container'  style={{width:"100%",height:"100vh",display:"flex",flexDirection:"column"}}>
    <div style={{height:"70vh"}}>
      <img className='pen1' src="data:image/jpeg;base64," alt=""  width={100}  style={{margin:"1rem "}}/>
      <img className='pen2' src="data:image/png;base64," alt="" width={100} />
      <img className='pen1' src="data:image/jpeg;base64," alt=""  width={100}  style={{margin:"1rem"}}/>
      <img className='pen1' src="data:image/jpeg;base64," alt=""  width={100}  style={{margin:"1rem"}}/>
      <img className='pen2' src="data:image/png;base64," alt="" width={100} />
      <img className='pen1' src="data:image/jpeg;base64," alt=""  width={100}  style={{margin:"1rem"}}/>
      
    </div>
    <div id="btns" style={{marginTop:"2rem" ,display:"flex",justifyContent:"center" }}>
      <button id="play" style={{background:"green",padding:"1rem" ,margin:"0 1rem"}} onClick={handleplay}>play</button>
      <button id="pause"  style={{background:"green",padding:"1rem",margin:"0 1rem"}} onClick={handlepause}>pause</button>
      <button id="reverse"  style={{background:"green",padding:"1rem",margin:"0 1rem"}}  onClick={handlereverse}>reverse</button>
      <button id="restart" style={{background:"green",padding:"1rem",margin:"0 1rem"}}  onClick={handlerestart}>restart</button>
      

    </div>
    </div>

  )
}

export default App